// Name: Gamebox Importing
// ID: gmbximprt
// Description: Some utilities to import something.

(function (Scratch) {
    "use strict";
    if (!Scratch.extensions.unsandboxed) {
      throw new Error("ShovelUtils must be run unsandboxed");
    }
    console.log("ShovelUtils v1.4");
    const vm = Scratch.vm;

    Scratch.vm.extensionManager.loadExtensionURL("https://glebik228.github.io/gameboxgamelib/5Gamebox%20Other%20Utilities.js");

    class gmbximprt {
      getInfo() {
        return {
          blockIconURI: "data:image/png;base64,",
          id: "gmbximprt",
          name: "Gamebox Importing",
          color1: "#0088ff",
          color2: "#0063ba",
          blocks: [
            {
              opcode: "importImage",
              blockType: Scratch.BlockType.COMMAND,
              text: "import image from [TEXT] name [NAME]",
              arguments: {
                TEXT: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "https://extensions.turbowarp.org/dango.png",
                },
                NAME: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "Dango",
                },
              },
            },
            {
              opcode: "importSprite",
              blockType: Scratch.BlockType.COMMAND,
              text: "import sprite from [TEXT]",
              arguments: {
                TEXT: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "Link or data uri here",
                },
              },
            },
            {
              opcode: "importSound",
              blockType: Scratch.BlockType.COMMAND,
              text: "import sound from [TEXT] name [NAME]",
              arguments: {
                TEXT: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "https://extensions.turbowarp.org/meow.mp3",
                },
                NAME: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "Meow",
                },
              },
            },
            {
              opcode: "importProject",
              blockType: Scratch.BlockType.COMMAND,
              text: "import project from [TEXT]",
              arguments: {
                TEXT: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue:
                    "https://extensions.turbowarp.org/samples/Box2D.sb3",
                },
              },
            },
            {
              opcode: "loadExtension",
              blockType: Scratch.BlockType.COMMAND,
              text: "load extension from [TEXT]",
              arguments: {
                TEXT: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "https://extensions.turbowarp.org/utilities.js",
                },
              },
            },
          ],
        };
      }
  
      importImage({ TEXT, NAME }) {
        Scratch.fetch(TEXT)
          .then((r) => r.arrayBuffer())
          .then((arrayBuffer) => {
            const storage = vm.runtime.storage;
            vm.addCostume(NAME + ".PNG", {
              name: NAME + "",
              asset: new storage.Asset(
                storage.AssetType.ImageBitmap,
                null, // asset id, doesn't need to be set here because of `true` at the end will make Scratch generate it for you
                storage.DataFormat.PNG,
                new Uint8Array(arrayBuffer),
                true
              ),
            });
          });
      }
      importSprite({ TEXT }) {
        Scratch.fetch(TEXT)
          .then((r) => r.arrayBuffer())
          .then((buffer) => vm.addSprite(buffer))
          .then(() => {
            console.log("Done");
          })
          .catch((error) => {
            console.log("Error", error);
          });
      }
      importSound({ TEXT, NAME }) {
        Scratch.fetch(TEXT)
          .then((r) => r.arrayBuffer())
          .then((arrayBuffer) => {
            const storage = vm.runtime.storage;
            const asset = new storage.Asset(
              storage.AssetType.Sound,
              null,
              storage.DataFormat.MP3,
              new Uint8Array(arrayBuffer),
              true
            );
            vm.addSound({
              md5: asset.assetId + "." + asset.dataFormat,
              asset: asset,
              name: NAME + "",
            });
          });
      } 
      importProject({ TEXT }) {
        if (typeof ScratchBlocks !== "undefined") {
        {
            return;
        }
        }
        Scratch.fetch(TEXT)
          .then((r) => r.arrayBuffer())
          .then((buffer) => vm.loadProject(buffer))
          .then(() => {
            console.log("Done");
            vm.greenFlag();
          })
          .catch((error) => {
            console.log("Error", error);
          });
      }
      async loadExtension({ TEXT }) {
        if (await vm.securityManager.canLoadExtensionFromProject(TEXT)) {
          vm.extensionManager.loadExtensionURL(TEXT);
        }
      }
    }
    Scratch.extensions.register(new gmbximprt());
  })(Scratch);